import React, { Component } from 'react';
import './AdminHome.css';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';
import {
  withRouter
} from 'react-router-dom';
import Form from 'react-bootstrap/Form';

class NavWithDropDown extends Component {
    render(){
        return(
            <Container>
                <Navbar bg="dark" variant="dark">
                        <Navbar.Brand href="/adminHome">StockChart</Navbar.Brand>
                        <Nav className="mr-auto">
                        <Nav.Link href="#home">Import Data</Nav.Link>
                        <Nav.Link href="#features">Manage Company</Nav.Link>
                        <Nav.Link href="#pricing">Manage Exchange</Nav.Link>
                        <Nav.Link href="#pricing">Manage IPO</Nav.Link>
                        </Nav>
                        <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-info">Search</Button>
                        </Form>
                    </Navbar>
                    <br />
            </Container>
        );
    }
}
class AdminHome extends Component {
    render(){
        return(
            <NavWithDropDown />
        );
    }
}

export default AdminHome;
